import React, {useEffect, useState} from 'react';
import './App.css';

function App() {
  var [currentQuestion, setCurrentQuestion] = useState("");
  var [currentQuestioner, setCurrentQuestioner] = useState("");
  var [previewQuestion, setPreviewQuestion] = useState("");
  var [previewQuestioner, setPreviewQuestioner] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        console.log(data);
        setCurrentQuestioner(data.values[0][0]);
        setCurrentQuestion(data.values[0][1]);
      })
    );
  }, [])

  return (
    <div className="App">
      <form>
        <label>
          Form Link
         <input type="text" name="preview" />
        </label>
        <input type="submit" value="Update" onClick={function () { alert('yeet');}} />
     </form>
      <form>
        <label>
          Preview Question
         <input type="text" name="preview" />
        </label>
        <input type="submit" value="Jump" />
     </form>
      <button className='yeet' onClick={function() { alert('click'); setCurrentQuestion("dad"); }}>
        Answer
      </button>
      <button className='yeet' onClick={function() { alert('click'); setCurrentQuestion("dad"); }}>
        Skip
      </button>
      <p className="previewQuestioner"><b>{previewQuestioner}</b></p>
      <p className="previewQuestion">{previewQuestion}</p>
      <p className="currentQuestioner"><b>{currentQuestioner}</b></p>
      <p className="currentQuestion">{currentQuestion}</p>
    </div>
  );
}

export default App;
